import React from 'react';
import { Helmet } from 'react-helmet';
import styled from 'styled-components';

const HomeContainer = styled.div`
  text-align: center;
  padding: 50px;
  color: #333;
`;

const Heading = styled.h1`
  font-size: 2.5em;
  color: #333;
`;

const Content = styled.p`
  font-size: 1.2em;
  line-height: 1.6;
  color: #666;
`;

const Home = () => {
  return (
    <HomeContainer>
      <Helmet>
        <title>Welcome to TechBitz - Your One-Stop Digital Solution</title>
        <meta name="description" content="Embrace the future of digital with TechBitz. We offer comprehensive solutions in Digital Marketing, Web Design & Development, SEO, and Advertisement." />
        <meta name="keywords" content="Digital Marketing, Web Design, Web Development, SEO, Advertisement, TechBitz, Brand Visibility, Digital Presence, Digital Strategies, Data-Driven Marketing, Audience Engagement, Conversion Optimization." />
      </Helmet>
      <Heading>Welcome to TechBitz</Heading>
      <Content>
        The comprehensive hub for all your digital needs. In this fast-paced digital age, having a strong online presence is vital for success. This is where we come in. With an expert team skilled in Digital Marketing, Web Design & Development, SEO, and Advertisement, we provide tailored solutions designed to elevate your brand's digital footprint.
      </Content>
      <Content>
        At TechBitz, we don't just create websites; we build digital experiences that engage and convert. Through our data-driven digital marketing strategies and robust SEO techniques, we ensure your brand is visible, compelling, and reaches the right audience at the right time. Discover the TechBitz difference today.
      </Content>
    </HomeContainer>
  );
}

export default Home;
